(function() {

	$.each(["desktop", "laptop", "tablet", "phone"], function(i, flag) {
		var $device = $("[data-device="+ flag +"]");

		var resize = function() {

			if ($device.is(":visible") && DEVICE!=flag) {
				DEVICE = flag;
				$(document).trigger("eventDevice");
			}

		};

		$(window).on("load resize", function() {
			resize();
		});

	});

})();
