/*
	выпадающее Меню
	------------------------------------------
	использованные библиотеки:
 	------------------------------------------ */
(function() {

	var $body 	= $("body");
	var $nav 		= $("[data-nav=\"catalog\"]");
	var $btn 		= $("[data-button=\"catalog\"]");
	var showed	= $body.hasClass("show--catalog");

	var show = function() {
		showed = true;
		$body.addClass("show--catalog");
		$(document).trigger("showCatalogNavEvent");
	};

	var hide = function() {
		showed = false;
		$body.removeClass("show--catalog");
		$nav.trigger("hideNavEvent");
		$(document).trigger("hideCatalogNavEvent");
	};

	$nav.find(".li-drop").each(function() {
		var $li 	= $(this);
		var $link = $li.children("a");
		var $drop = $li.children("ul");
		var opened = $li.hasClass("toggled");

		var open = function() {
			opened = true;
			$li.addClass("toggled");
			$drop.slideDown(300);
		};

		var close = function() {
			opened = false;
			$li.removeClass("toggled");
			$drop.slideUp(300, function() {
				$(this)
					.removeAttr("style")
					.find(".toggled").removeClass("toggled").find("ul").removeAttr("style");
			});
		};

		$link.on("click", function(e) {
			var opened = $li.hasClass("toggled");
			e.preventDefault();
			if (opened) close(); else open();
		});

		$nav.bind("hideNavEvent", function() {
			if (opened) close();
		});
	});

	$btn.on("click", function(e) {
		e.preventDefault();
		if (showed) hide(); else show();
	});

})();
