/*
	выпадающие Меню в подвале
	------------------------------------------
	использованные библиотеки:
 	------------------------------------------ */
(function() {

	var $body 	= $("body");
	var $nav 		= $("[data-nav=\"footer\"]");

	$nav.find("[data-role=\"toggle\"]").each(function() {
		var $drop = $(this);
		var $btn 	= $drop.parent("div").find("[data-button=\"toggle\"]");
		var toggled = $btn.hasClass("toggled");

		var open = function() {
			toggled = true;
			$btn.addClass("toggled");
			$drop.slideDown(300);
		};

		var close = function(silent_mode) {
			toggled = false;
			$btn.removeClass("toggled");
			if (silent_mode) {
				$drop.removeAttr("style");
			} else $drop.slideUp(300, function() {
							$(this).removeAttr("style");
						});
		};

		var check = function() {
			if (DEVICE!="phone" && toggled) close(true);
		};

		check();

		$(document).bind("eventDevice", function() {
			check();
		});

		$btn.on("click", function(e) {
			if (DEVICE=="phone") {
				if (toggled) close(); else open();
			}
			e.preventDefault();
		});
	});

})();
