/*
	секция Предложения
	------------------------------------------
	использованные библиотеки:
	- https://idangero.us/swiper/
 	------------------------------------------ */
(function() {

	var $section = $("[data-role=\"offers\"]");

	if (!$section["length"]) return false;

	var $slider 	= $section.find("[data-role=\"carousel\"]");
	var $sliderIn = $section.find("[data-role=\"carousel-in\"]");
	var $slides 	= $section.find("[data-role=\"slide\"]");
	var slider;

	var init = function() {
		$slider.addClass("swiper-container");
		$sliderIn
			.removeClass("row")
			.addClass("swiper-wrapper");
		$slides.addClass("swiper-slide");

		slider = new Swiper($slider, {
			direction: "horizontal",
			loop: false,
			speed: 600,
			slideActiveClass: "active",
			spaceBetween: 0,
			slidesPerView: "auto",
			lazy: {
				loadPrevNext: true
			}
		});

		slider
			.on("lazyImageReady", function(slideEl, imageEl) {
	  		$(slideEl).addClass("loaded");
			});
	};

	var destroy = function() {
		slider.destroy();
		slider = false;

		$slider.removeClass("swiper-container");
		$sliderIn
			.removeClass("swiper-wrapper")
			.addClass("row")
		$slides.removeClass("swiper-slide");
	};

	var check = function() {
		if ((DEVICE=="tablet"||DEVICE=="phone") && !slider) init();
		if (DEVICE!="tablet" && DEVICE!="phone" && slider) destroy();
	};

	$(document).bind("eventDevice", function() {
		check();
	});

})();
